import "../css/App.css";
import React, { useState, useEffect } from "react";
import { useStateValue } from "./StateProvider";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Test from "./Test";
import Result from "./Result";
// import Header from "./Header";
// import Menu from "./Menu";
const useStateWithSessionStorage = (sessionStorageKey) => {
  const [value, setValue] = useState(
    sessionStorage.getItem(sessionStorageKey) || ""
  );

  useEffect(() => {
    sessionStorage.setItem(localSessionKey, value);
  }, [value]);
};

function App() {
  const [{ contactId }, dispatch] = useStateValue();
  const [value, setValue] = useStateWithSessionStorage("contactId");
  const urlParams = new URLSearchParams(useLocation.search());
  const contactIdParam = 0;

  if (urlParams.has("contactId")) {
    contactIdParam = urlParams.get("contactId");
  }
  if (contactId + 0 > 1) {
    setValue(contactIdParam);
  } else {
    console.log("üîê contactId was not set...");
  }

  return (
    <div className="app">
      <Router basename="/get-started">
        {/* <Header /> */}
        <Switch>
          <Route path="/result">
            <Result />
          </Route>
          <Route path="/">
            <Test />
          </Route>
          {/* <Route path="/">
            <Menu />
          </Route> */}
        </Switch>
      </Router>
    </div>
  );
}

export default App;
